INSERT INTO `movies` (`id`, `e_id`, `title`, `description`, `poster`, `banner`, `type`, `release_date`, `vote`, `vote_count`, `created_at`, `updated_at`) VALUES
(1, 1038392, 'The Conjuring: Last Rites', 'Paranormal investigators Ed and Lorraine Warren take on one last terrifying case involving mysterious entities they must confront.', '/7JzOmJ1fIU43I3gLHYsY8UzNzjG.jpg', '/9DYFYhmbXRGsMhfUgXM3VSP9uLX.jpg', 'upcoming', '2025-09-03', 6.957, 899, '2025-10-13 21:46:48', '2025-10-13 21:47:21'),
(2, 1086910, 'The Lost Princess', 'After an Ayahuasca vision transports him to a haunted castle, Alec meets Hanna who tales him the story of her mother\'s forced marriage and how the forbidden passion with her father was in danger when the princess pregnancy became obvious', '/31S2ISsDtbnxb0kuXZl1SxSMD0K.jpg', '/ax2qCKU6tUhdkStiCnrDdXKA5xC.jpg', 'upcoming', '2025-10-16', 5.923, 13, '2025-10-13 21:46:48', '2025-10-13 21:47:21'),
(3, 338969, 'The Toxic Avenger Unrated', 'When a downtrodden janitor, Winston Gooze (Peter Dinklage), is exposed to a catastrophic toxic accident, he’s transformed into a new kind of hero: The Toxic Avenger. Now, Toxie must rise from outcast to savior, taking on ruthless corporate overlords and corrupt forces who threaten his son, his friends, and his community.', '/sIonGSpGNtH72OzbJllPOEMNjVU.jpg', '/wyg8OaiDFru4NWuEnhCIsF3W1Ek.jpg', 'upcoming', '2025-08-28', 6.114, 110, '2025-10-13 21:46:48', '2025-10-13 21:47:21'),
(4, 1311031, 'Demon Slayer: Kimetsu no Yaiba Infinity Castle', 'The Demon Slayer Corps are drawn into the Infinity Castle, where Tanjiro, Nezuko, and the Hashira face terrifying Upper Rank demons in a desperate fight as the final battle against Muzan Kibutsuji begins.', '/sUsVimPdA1l162FvdBIlmKBlWHx.jpg', '/1RgPyOhN4DRs225BGTlHJqCudII.jpg', 'now_playing', '2025-07-18', 7.813, 450, '2025-10-13 21:46:49', '2025-10-13 21:47:05'),
(5, 755898, 'War of the Worlds', 'Will Radford is a top analyst for Homeland Security who tracks potential threats through a mass surveillance program, until one day an attack by an unknown entity leads him to question whether the government is hiding something from him... and from the rest of the world.', '/yvirUYrva23IudARHn3mMGVxWqM.jpg', '/iZLqwEwUViJdSkGVjePGhxYzbDb.jpg', 'popular', '2025-07-29', 4.349, 621, '2025-10-13 21:46:49', '2025-10-13 21:46:49'),
(6, 1186350, 'Marco', 'The adoptive son of the Adattu family, Marco, sets off on a ruthless quest for vengeance after his brother is brutally murdered, finding only betrayal, loss and unimaginable brutality at every step.', '/il3ao5gcF6fZNqo1o9o7lusmEyU.jpg', '/a6RkQIOZ6wThQOEDv6lHsfH53hD.jpg', 'popular', '2024-12-20', 6.367, 64, '2025-10-13 21:46:50', '2025-10-13 21:46:50'),
(7, 793387, 'Holy Night: Demon Hunters', 'When a devil-worshipping criminal network plunges Seoul into chaos, the police turn to Holy Night—a trio of supernatural demon hunters—to restore order and defeat the rising evil.', '/v3Mo77Qjp6pctpD4eJaNT6kFRSB.jpg', '/5A01YSCPYoCOZOhh9tU7F3Htxkf.jpg', 'popular', '2025-04-30', 6.521, 47, '2025-10-13 21:46:50', '2025-10-13 21:46:50'),
(8, 941109, 'Play Dirty', 'Expert thief Parker gets a shot at a major heist, but to pull it off he and his team must outsmart a South American dictator, the New York mob, and the world\'s richest man.', '/ovZ0zq0NwRghtWI1oLaM0lWuoEw.jpg', '/k6tdiMTO39RQj3dhfspuzprfoe0.jpg', 'now_playing', '2025-09-30', 6.64, 278, '2025-10-13 21:46:50', '2025-10-13 21:47:05'),
(9, 617126, 'The Fantastic 4: First Steps', 'Against the vibrant backdrop of a 1960s-inspired, retro-futuristic world, Marvel\'s First Family is forced to balance their roles as heroes with the strength of their family bond, while defending Earth from a ravenous space god called Galactus and his enigmatic Herald, Silver Surfer.', '/cm8TNGBGG0aBfWj0LgrESHv8tir.jpg', '/7FnmZCAjAwaHydgpjFKnu11MoWs.jpg', 'popular', '2025-07-23', 7.142, 1960, '2025-10-13 21:46:51', '2025-10-13 21:46:51'),
(10, 1257009, 'Primitive War', 'During the Vietnam War, a recon unit ventures to an isolated jungle valley to uncover the fate of a missing platoon. They soon find themselves in a fight for their lives against an unexpected enemy — prehistoric dinosaurs.', '/nWBqU5YXmDVJWWEDJ4u3ZSseNVL.jpg', '/bWF5ImUscXXYia8owpm8coadR4m.jpg', 'upcoming', '2025-08-21', 6.926, 101, '2025-10-13 21:46:51', '2025-10-13 21:47:22'),
(11, 986097, 'HIM', 'After suffering a potentially career-ending brain trauma, Cameron Cade receives a lifeline when his hero, legendary eight-time Championship quarterback and cultural megastar Isaiah White, offers to train Cam at Isaiah\'s isolated compound that he shares with his celebrity influencer wife. But as Cam\'s training accelerates, Isaiah\'s charisma begins to curdle into something darker.', '/qPJzcYR2f1O1uynYBCVPPJuOiAH.jpg', '/jzzpCJWkVZZwAxzzLmtYN0MBWFd.jpg', 'upcoming', '2025-09-18', 5.71, 119, '2025-10-13 21:46:52', '2025-10-13 21:47:22'),
(12, 1290879, 'The Woman in Cabin 10', 'On a lavish yacht for an assignment, a journalist sees a passenger go overboard. But when no one believes her, she risks her life to uncover the truth.', '/4kpdyePOlcELQQJcxXPF5GB1Adw.jpg', '/a9SLDj7GPKxeuOjoYkgr5nz1IOl.jpg', 'now_playing', '2025-10-09', 6.175, 174, '2025-10-13 21:46:52', '2025-10-13 21:47:06'),
(13, 533533, 'TRON: Ares', 'A highly sophisticated Program called Ares is sent from the digital world into the real world on a dangerous mission, marking humankind\'s first encounter with A.I. beings.', '/chpWmskl3aKm1aTZqUHRCtviwPy.jpg', '/2OvpmWYrsv8eMyV3AAqhoMnzMF.jpg', 'upcoming', '2025-10-08', 6.5, 173, '2025-10-13 21:46:52', '2025-10-13 21:47:22'),
(14, 1251717, 'Vicious', 'When Polly (Dakota Fanning) receives a mysterious box, it comes with one rule: place inside something she needs, something she hates, and something she loves. If she doesn’t obey, it will consume everything—and everyone—she’s ever known.', '/shKGDGrwqmc9x2aTJcQszoXinq0.jpg', '/da1mXvCrQrFcw6BxovCavBFbIvz.jpg', 'now_playing', '2025-09-19', 5.949, 39, '2025-10-13 21:46:53', '2025-10-13 21:47:07'),
(15, 1328803, 'Prisoner of War', 'British RAF Wing Commander James Wright is captured by the Japanese during WWII and forced to fight in brutal hand-to-hand combat. The Japanese soldiers get more than they bargained for when Wright’s years of martial arts training in Hong Kong prove him to be a formidable opponent.', '/1XET89sjRm9mUuHXhGIlKTNd5uD.jpg', '/yGByIyqgJerCw7AAphTrTAlrdkJ.jpg', 'now_playing', '2025-09-19', 7.051, 79, '2025-10-13 21:46:53', '2025-10-13 21:47:07'),
(16, 803796, 'KPop Demon Hunters', 'When K-pop superstars Rumi, Mira and Zoey aren\'t selling out stadiums, they\'re using their secret powers to protect their fans from supernatural threats.', '/AjlRXTpRLAIiuofNqKcqrpUfPCZ.jpg', '/w3Bi0wygeFQctn6AqFTwhGNXRwL.jpg', 'upcoming', '2025-06-20', 8.266, 1654, '2025-10-13 21:46:54', '2025-10-13 21:47:23'),
(17, 1267319, 'Mantis', 'Mantis, an ace assassin, returns to the contract killer industry after a hiatus, encountering his trainee friend Jae-yi and a retired legendary killer Dok-go, who now runs the organization.', '/xS9bbciDC5lHPgl79SrPyzxKAXL.jpg', '/yOFqBpJ0PEkBdQqalDEaeOiaKbz.jpg', 'now_playing', '2025-09-26', 5.936, 86, '2025-10-13 21:46:54', '2025-10-13 21:47:08'),
(18, 1053008, 'Fight Another Day', 'Follows a tough cop, who after being transported to a dystopian future, must enter a deadly combat tournament to be able to return to his past.', '/fKnLt1xQV0RdpN6RViowEiD1dFW.jpg', '/znMUHotZRTcyIFWFz2bvcpSx6YP.jpg', 'popular', '2024-10-09', 5.111, 18, '2025-10-13 21:46:54', '2025-10-13 21:46:54'),
(19, 1061474, 'Superman', 'Superman, a journalist in Metropolis, embarks on a journey to reconcile his Kryptonian heritage with his human upbringing as Clark Kent.', '/wPLysNDLffQLOVebZQCbXJEv6E6.jpg', '/eGX66zonvc4bXg3rM08RUxdYSDx.jpg', 'popular', '2025-07-09', 7.447, 3580, '2025-10-13 21:46:55', '2025-10-13 21:46:55'),
(20, 1009640, 'Valiant One', 'With tensions between North and South Korea, a US helicopter crashes on the North side. The survivors must work together to protect a civilian tech specialist and find their way out without the help of US military support.', '/sT8Z14RDCAd6szzxzWFAU4xcMwg.jpg', '/aIsjCdfiAS89cMjdDWEpKmUTHsZ.jpg', 'popular', '2025-01-30', 6.3, 44, '2025-10-13 21:46:55', '2025-10-13 21:46:55'),
(21, 1357886, 'Django Undisputed', 'Determined to exact his justice, Django faces dangerous challenges and bloody clashes to restore order in a territory dominated by lawlessness and injustice.', '/porcUhC4jqFt72TaxbjOQo2lTzL.jpg', '/nvdLEfAWcfTNn45SpwBnLGBmOR1.jpg', 'popular', '2024-04-22', 6.056, 9, '2025-10-13 21:46:56', '2025-10-13 21:46:56'),
(22, 575265, 'Mission: Impossible - The Final Reckoning', 'Ethan Hunt and team continue their search for the terrifying AI known as the Entity — which has infiltrated intelligence networks all over the globe — with the world\'s governments and a mysterious ghost from Hunt\'s past on their trail. Joined by new allies and armed with the means to shut the Entity down for good, Hunt is in a race against time to prevent the world as we know it from changing forever.', '/z53D72EAOxGRqdr7KXXWp9dJiDe.jpg', '/538U9snNc2fpnOmYXAPUh3zn31H.jpg', 'popular', '2025-05-17', 7.3, 1910, '2025-10-13 21:46:56', '2025-10-13 21:46:56'),
(23, 1547527, 'Stay', 'Kiara, a PhD author on African spirituality, and Miles, a former MMA fighter turned trainer, facing the end of their marriage. They encounter supernatural forces and go from fighting one another to fighting for their lives. To survive, they must conquer darkness with love.', '/kRMzvzxjClWJn7bQtaRLQ2qhb6c.jpg', '/yo1DleICj1CLlUjXymo5pNMJDFd.jpg', 'now_playing', '2025-10-07', 2.875, 4, '2025-10-13 21:46:57', '2025-10-13 21:47:09'),
(24, 1054867, 'One Battle After Another', 'Washed-up revolutionary Bob exists in a state of stoned paranoia, surviving off-grid with his spirited, self-reliant daughter, Willa. When his evil nemesis resurfaces after 16 years and she goes missing, the former radical scrambles to find her, father and daughter both battling the consequences of his past.', '/m1jFoahEbeQXtx4zArT2FKdbNIj.jpg', '/zpEWFNqoN8Qg1SzMMHmaGyOBTdW.jpg', 'upcoming', '2025-09-23', 7.801, 814, '2025-10-13 21:46:57', '2025-10-13 21:47:23'),
(25, 1078605, 'Weapons', 'When all but one child from the same class mysteriously vanish on the same night at exactly the same time, a community is left questioning who or what is behind their disappearance.', '/cpf7vsRZ0MYRQcnLWteD5jK9ymT.jpg', '/Q2OajDi2kcO6yErb1IAyVDTKMs.jpg', 'upcoming', '2025-08-04', 7.403, 1867, '2025-10-13 21:46:58', '2025-10-13 21:47:24'),
(26, 1087192, 'How to Train Your Dragon', 'On the rugged isle of Berk, where Vikings and dragons have been bitter enemies for generations, Hiccup stands apart, defying centuries of tradition when he befriends Toothless, a feared Night Fury dragon. Their unlikely bond reveals the true nature of dragons, challenging the very foundations of Viking society.', '/53dsJ3oEnBhTBVMigWJ9tkA5bzJ.jpg', '/AeDzjt00Hfh9CuW7TIUdYBJmWYM.jpg', 'now_playing', '2025-06-06', 8.017, 2038, '2025-10-13 21:46:58', '2025-10-13 21:47:10'),
(27, 1352755, 'Maintenance Required', 'Charlie, the fiercely independent owner of an all-female mechanic shop, is forced to reevaluate her future when a flashy corporate competitor moves in across the street. Seeking comfort, she turns to an anonymous online confidant - unaware she\'s confiding in Beau, the very rival threatening her business. As sparks fly both online and off, the truth threatens to blow everything apart.', '/lM7Q1y0pmHPWZCPmGkAWGKdgu6W.jpg', '/uxRCrEMJlfCILQhkcDuDpadkQC9.jpg', 'now_playing', '2025-10-07', 5.62, 46, '2025-10-13 21:46:58', '2025-10-13 21:47:10'),
(28, 1277988, 'Caramelo', 'After a life-changing diagnosis, a promising chef finds hope and humor with the help of a fur-midable dog friend.', '/ur3H6g9xmrLQX2Ioh9z3P904ZSC.jpg', '/c2dPK558peXs9QzacwzHYQqqS2r.jpg', 'now_playing', '2025-10-08', 6.787, 47, '2025-10-13 21:46:59', '2025-10-13 21:47:11'),
(29, 7451, 'xXx', 'Xander Cage is your standard adrenaline junkie with no fear and a lousy attitude. When the US Government \"recruits\" him to go on a mission, he\'s not exactly thrilled. His mission: to gather information on an organization that may just be planning the destruction of the world, led by the nihilistic Yorgi.', '/xeEw3eLeSFmJgXZzmF2Efww0q3s.jpg', '/4QXRStvIJHsHLUf6hr7aweMX7em.jpg', 'popular', '2002-08-09', 5.965, 4585, '2025-10-13 21:46:59', '2025-10-13 21:46:59'),
(30, 1236470, 'The Lost Bus', 'A determined father risks everything to rescue a dedicated teacher and her students from a raging wildfire.', '/zpygCOYY1DPBkeUsrrznLRN5js5.jpg', '/lL4zajQbvvo63z2CNu36Ue6wpBX.jpg', 'now_playing', '2025-09-19', 7.194, 268, '2025-10-13 21:47:00', '2025-10-13 21:47:11'),
(31, 1234821, 'Jurassic World Rebirth', 'Five years after the events of Jurassic World Dominion, covert operations expert Zora Bennett is contracted to lead a skilled team on a top-secret mission to secure genetic material from the world\'s three most massive dinosaurs. When Zora\'s operation intersects with a civilian family whose boating expedition was capsized, they all find themselves stranded on an island where they come face-to-face with a sinister, shocking discovery that\'s been hidden from the world for decades.', '/1RICxzeoNCAO5NpcRMIgg1XT6fm.jpg', '/fncHijpWjitFBmj7SX5z148XEhP.jpg', 'popular', '2025-07-01', 6.396, 2295, '2025-10-13 21:47:00', '2025-10-13 21:47:00'),
(32, 1512581, 'No Tears in Hell', 'In the frozen darkness of an Alaskan winter, a mother and son turn their home into a house of nightmares — luring victims into a twisted web of abuse and cannibalism. Based on the terrifying true story of Russian serial killer Alexander Spesivtsev.', '/a0bODl3Ieix1qcGRLIx6PZvluzB.jpg', '/j6OkZpiBZPXGGN0EFSIN1Rg7xI.jpg', 'popular', '2025-08-12', 6, 11, '2025-10-13 21:47:00', '2025-10-13 21:47:00'),
(33, 1552819, 'Assassin', '', '/fLRCNUz3MsnC0MdhaWpw3hp4Eye.jpg', '/gZF6fDtE71Fi3AGcF0PSQAxCgE3.jpg', 'now_playing', '2025-09-26', 4.375, 8, '2025-10-13 21:47:01', '2025-10-13 21:47:11'),
(34, 911430, 'F1', 'Racing legend Sonny Hayes is coaxed out of retirement to lead a struggling Formula 1 team—and mentor a young hotshot driver—while chasing one more chance at glory.', '/9PXZIUsSDh4alB80jheWX4fhZmy.jpg', '/ZtcGMc204JsNqfjS9lU6udRgpo.jpg', 'popular', '2025-06-25', 7.834, 2359, '2025-10-13 21:47:01', '2025-10-13 21:47:01'),
(35, 1218925, 'Chainsaw Man - The Movie: Reze Arc', 'In a brutal war between devils, hunters, and secret enemies, a mysterious girl named Reze has stepped into Denji\'s world, and he faces his deadliest battle yet, fueled by love in a world where survival knows no rules.', '/xdzLBZjCVSEsic7m7nJc4jNJZVW.jpg', '/dh0dLVLDLqUKhtytCFjkf3EHeJI.jpg', 'upcoming', '2025-09-19', 8.6, 20, '2025-10-13 21:47:02', '2025-10-13 21:47:24'),
(36, 1175942, 'The Bad Guys 2', 'The now-reformed Bad Guys are trying (very, very hard) to be good, but instead find themselves hijacked into a high-stakes, globe-trotting heist, masterminded by a new team of criminals they never saw coming: The Bad Girls.', '/c1msaKf1wyuKcmLjjJd6rIBPFcd.jpg', '/lB96EMr5A7Og81UhyldJvvy35r.jpg', 'now_playing', '2025-07-24', 7.797, 462, '2025-10-13 21:47:02', '2025-10-13 21:47:12'),
(37, 1007734, 'Nobody 2', 'Former assassin Hutch Mansell takes his family on a nostalgic vacation to a small-town theme park, only to be pulled back into violence when they clash with a corrupt operator, a crooked sheriff, and a ruthless crime boss.', '/xGLoqM9peusKQeuwlSw2Qlhx740.jpg', '/mEW9XMgYDO6U0MJcIRqRuSwjzN5.jpg', 'upcoming', '2025-08-13', 7.106, 811, '2025-10-13 21:47:03', '2025-10-13 21:47:24'),
(38, 1385169, 'Rumpelstiltskin', 'Once upon a time, a miller attempted to marry his daughter off to the King by promising she could spin straw into gold. With the help of a demonic imp, she completes the task, but the King becomes greedy and wants more. So, she promises the imp her firstborn in return for yet more favours. But when it comes time to honour her bargain, dark forces merge when the Imp makes a deal with the devil.', '/2irI6Bx5dU754W52rReruUj3RI2.jpg', '/vW25IT0VyK99drGVdVGpMusohbl.jpg', 'popular', '2025-03-08', 6.273, 11, '2025-10-13 21:47:03', '2025-10-13 21:47:03'),
(39, 1549457, 'Gypsy Moon', 'The year is 1799 Romania. The Gypsy people on the verge of having their lands taken over by bloodthirsty rulers known as \"The Order\" An officer of the Order \"Captain\" finds his way into a twist of fate and his bloodthirsty companions.', '/6jehxNC3pAk5S2a9ZeadumjCP33.jpg', '/ouPSklDn0h18yz1KtBIIGnxFkCb.jpg', 'popular', '2024-02-14', 4, 1, '2025-10-13 21:47:03', '2025-10-13 21:47:03'),
(40, 1032448, 'Jurassic Triangle', 'A group of colleagues crash land on a mysterious island that they cannot escape. They discover they are not alone when they encounter an array of blood thirsty creatures and dinosaurs out to get them. Will they survive the island?', '/yLxLz8RHiOLtNvKCtJYQgDFXqBU.jpg', '/3IcJRIjMo4G1A6HtCHiKCUAyfIw.jpg', 'popular', '2024-02-13', 2.8, 10, '2025-10-13 21:47:04', '2025-10-13 21:47:04'),
(41, 987400, 'Aztec Batman: Clash of Empires', 'In the time of the Aztec empire, tragedy strikes Yohualli Coatl when his father is murdered by Spanish conquistadors. To warn King Moctezuma and his high priest, Yoka, of imminent danger, Yohualli escapes to Tenochtitlán. There, he trains in the temple of the bat god Tzinacan with his mentor, developing equipment and weaponry to confront the Spanish invasion and avenge his father’s death. Along the way, he encounters key figures like the fierce Jaguar Woman and the conquistador Hernán Cortés.', '/s0Mlo5w4INp3bUdsJo3RaSSMXWz.jpg', '/9KSboWOt09J72aMY4x8SS1IaOHK.jpg', 'now_playing', '2025-09-18', 7.88, 96, '2025-10-13 21:47:13', '2025-10-13 21:47:13'),
(42, 980477, 'Ne Zha 2', 'After a catastrophic event leaves their bodies destroyed, Ne Zha and Ao Bing are granted a fragile second chance at life. As tensions rise between the dragon clans and celestial forces, the two must undergo a series of perilous trials that will test their bond, challenge their identities, and decide the fate of both mortals and immortals.', '/cb5NyNrqiCNNoDkA8FfxHAtypdG.jpg', '/8btfz81bOJ2lC7cujYBTw03wzg3.jpg', 'now_playing', '2025-01-29', 8.043, 399, '2025-10-13 21:47:13', '2025-10-13 21:47:13'),
(43, 1284120, 'The Ugly Stepsister', 'In a fairy-tale kingdom where beauty is a brutal business, Elvira battles to compete with her incredibly beautiful stepsister, and she will go to any length to catch the prince’s eye.', '/crX9rSg9EohybhkEe8iTQUCe55y.jpg', '/eQV9rSQ6S1ja4lGTwHTnQuVhoG.jpg', 'upcoming', '2025-03-07', 7.231, 474, '2025-10-13 21:47:13', '2025-10-13 21:47:25'),
(44, 1125257, 'Freakier Friday', 'Years after Tess and Anna endured an identity crisis, Anna now has a daughter of her own and a soon-to-be stepdaughter. As they navigate the myriad challenges that come when two families merge, Tess and Anna discover lightning might indeed strike twice.', '/9wV65OmsjLAqBfDnYTkMPutXH8j.jpg', '/yQy9Y3p5INwkfTuHSnzYnz4MCV3.jpg', 'now_playing', '2025-08-06', 7, 270, '2025-10-13 21:47:14', '2025-10-13 21:47:14'),
(45, 1242011, 'Together', 'With a move to the countryside already testing the limits of a couple\'s relationship, a supernatural encounter begins an extreme transformation of their love, their lives, and their flesh.', '/m52XidzKx94bKlToZfEXUnL3pdy.jpg', '/fBlzTwgtbDYkDKlhnPu69jHfVGy.jpg', 'upcoming', '2025-07-28', 7.197, 594, '2025-10-13 21:47:14', '2025-10-13 21:47:25'),
(46, 1119878, 'Ice Road: Vengeance', 'Big rig ice road driver Mike McCann travels to Nepal to scatter his late brother’s ashes on Mt. Everest. While on a packed tour bus traversing the deadly 12,000 ft. terrain of the infamous Road to the Sky, McCann and his mountain guide encounter a group of mercenaries and must fight to save themselves, the busload of innocent travelers, and the local villagers’ homeland.', '/cQN9rZj06rXMVkk76UF1DfBAico.jpg', '/2nwhxEyefcIFKwOrSigiamoIzu2.jpg', 'now_playing', '2025-06-27', 6.313, 467, '2025-10-13 21:47:15', '2025-10-13 21:47:15'),
(47, 870360, 'The Day the Earth Blew Up: A Looney Tunes Movie', 'Porky and Daffy, the classic animated odd couple, turn into unlikely heroes when their antics at the local bubble gum factory uncover a secret alien mind control plot. Against all odds, the two are determined to save their town (and the world!)...that is if they don\'t drive each other crazy in the process.', '/s2lB1kaYCdGSnZX5meQCiOR6HfX.jpg', '/5U3VLeWr2H4Nd3G7IkHItFimsIz.jpg', 'now_playing', '2024-08-01', 7.7, 172, '2025-10-13 21:47:15', '2025-10-13 21:47:15'),
(48, 1223422, 'Motherland', 'In an alternate present society where the state frees parents from the burden of raising children, a rule enforcer learns a shocking truth that sparks her rebellion.', '/rE2UnEr9m8iLeuvWxaQyaNDKTHU.jpg', '/4F8CzBISEqO102GuTlURSXbiXg7.jpg', 'now_playing', '2025-09-12', 6.9, 8, '2025-10-13 21:47:15', '2025-10-13 21:47:15'),
(49, 1242404, 'Steve', 'Over one intense day, the devoted head teacher of a last-chance reform school strives to keep his students in line while facing pressures of his own.', '/wmLoMyofbseLfxiGgk1Iz5H97c3.jpg', '/m5UwDL3nLNQn9UDfteylgFIpxCJ.jpg', 'now_playing', '2025-09-19', 6.305, 95, '2025-10-13 21:47:16', '2025-10-13 21:47:16'),
(50, 1484640, 'Swim to Me', 'Estela, a young woman from rural Chile, embarks on a journey to Santiago, leaving her family behind to work as a maid for an affluent household.', '/5pkYUOyvxjAYlUpq4GDTp04gxMa.jpg', '/oVph5mMhp0UxVYeSpIfUfll0kcF.jpg', 'now_playing', '2025-09-25', 5.75, 6, '2025-10-13 21:47:16', '2025-10-13 21:47:16'),
(51, 1156594, 'Our Fault', 'Jenna and Lion\'s wedding brings about the long-awaited reunion between Noah and Nick after their breakup. Nick\'s inability to forgive Noah stands as an insurmountable barrier. He, heir to his grandfather\'s businesses, and she, starting her professional life, resist fueling a flame that\'s still alive. But now that their paths have crossed again, will love be stronger than resentment?', '/yzqHt4m1SeY9FbPrfZ0C2Hi9x1s.jpg', '/7QirCB1o80NEFpQGlQRZerZbQEp.jpg', 'upcoming', '2025-10-15', 0, 0, '2025-10-13 21:47:16', '2025-10-13 21:47:26'),
(52, 1382406, 'Striking Rescue', 'A veteran Muay Thai expert goes on a take-no-prisoners mission of revenge after his wife and daughter are brutally murdered by mysterious forces.', '/nML8rOI4GOiiEsXgknuhZeUF8M7.jpg', '/yth78N88nwokepnOe5atwPGfTL1.jpg', 'now_playing', '2024-12-05', 7.52, 126, '2025-10-13 21:47:17', '2025-10-13 21:47:17'),
(53, 1371189, 'Ruth & Boaz', 'A talented singer leaves the Atlanta music scene and starts over in small-town Tennessee, where she finds love and new purpose but can\'t escape the past.', '/mtMJEIHjeHcLtvP0tFPAptk1Var.jpg', '/m2e8GUES92IaXRCLxWElJnlZ34w.jpg', 'now_playing', '2025-09-25', 7.63, 50, '2025-10-13 21:47:17', '2025-10-13 21:47:17'),
(54, 13494, 'Red Sonja', 'A young girl rises from the ashes of tragedy to become the most feared warrior woman of all time: the She-Devil with a Sword.', '/aE3yh4y0h96CZZpLo0UDFMWZAA9.jpg', '/xSD0q1FiuZkvHuy7uscOLbmd1hR.jpg', 'now_playing', '2025-07-31', 5.765, 113, '2025-10-13 21:47:18', '2025-10-13 21:47:18'),
(55, 1071585, 'M3GAN 2.0', 'After the underlying tech for M3GAN is stolen and misused by a powerful defense contractor to create a military-grade weapon known as Amelia, M3GAN\'s creator Gemma realizes that the only option is to resurrect M3GAN and give her a few upgrades, making her faster, stronger, and more lethal.', '/4a63rQqIDTrYNdcnTXdPsQyxVLo.jpg', '/cT9ZfwoPDk8JbgkessmQgxAWiaM.jpg', 'now_playing', '2025-06-25', 7.414, 895, '2025-10-13 21:47:18', '2025-10-13 21:47:18'),
(56, 76600, 'Avatar: The Way of Water', 'Set more than a decade after the events of the first film, learn the story of the Sully family (Jake, Neytiri, and their kids), the trouble that follows them, the lengths they go to keep each other safe, the battles they fight to stay alive, and the tragedies they endure.', '/t6HIqrRAclMCA60NsSmeqe9RmNV.jpg', '/8rpDcsfLJypbO6vREc0547VKqEv.jpg', 'now_playing', '2022-12-14', 7.6, 12943, '2025-10-13 21:47:18', '2025-10-13 21:47:18'),
(57, 957121, 'The Man in My Basement', 'Down on his luck, Charles Blakey agrees to rent his basement to a mysterious stranger, unaware he may be letting in a force much darker than he imagined.', '/1zpeH8wOrM8p2TTAmBetwhe2BIx.jpg', '/xR75PgmIxhS6ChjNUKgz4krC9MR.jpg', 'now_playing', '2025-09-12', 5.2, 28, '2025-10-13 21:47:19', '2025-10-13 21:47:19'),
(58, 1289888, 'French Lover', 'When a jaded actor meets a down-on-her-luck waitress in Paris, their unexpected love story begins — but will it survive the glare of the spotlight?', '/bLqPpqNoKbNbXysIeft1tLIl6KB.jpg', '/p4OIGFfVo3vbROMD1evVF0u14Rf.jpg', 'now_playing', '2025-09-25', 5.746, 116, '2025-10-13 21:47:19', '2025-10-13 21:47:19'),
(59, 1193861, 'The Woman in the Line', 'Andrea visits her incarcerated son for the first time. Initially eyed with suspicion by other women in line, she gradually gains their trust — and emerges as a powerful advocate for justice reform.', '/n1PPU08b3ltuVhL7Dd5A8TMMR7t.jpg', '/fGrlT6p7IzmujKW0GPBESx2pXCp.jpg', 'now_playing', '2025-09-04', 7, 1, '2025-10-13 21:47:20', '2025-10-13 21:47:20'),
(60, 3933, 'Corpse Bride', 'In a 19th-century European village, a young man about to be married is whisked away to the underworld and wed to a mysterious corpse bride, while his real bride waits bereft in the land of the living.', '/isb2Qow76GpqYmsSyfdMfsYAjts.jpg', '/v23fWgJUEt8EMmvn19btIacxP8E.jpg', 'upcoming', '2005-09-12', 7.584, 9773, '2025-10-13 21:47:26', '2025-10-13 21:47:26'),
(61, 1245993, 'Caught Stealing', 'Burned-out ex-baseball player Hank Thompson unexpectedly finds himself embroiled in a dangerous struggle for survival amidst the criminal underbelly of late 1990s New York City, forced to navigate a treacherous underworld he never imagined.', '/yzhay59xLcHwvcsGfpqzh6zcgfG.jpg', '/zWO3B2CTDguZqCrVQ2u5Xnp9VRS.jpg', 'upcoming', '2025-08-26', 6.992, 373, '2025-10-13 21:47:26', '2025-10-13 21:47:26'),
(62, 1246049, 'Dracula: A Love Tale', 'The story of 15th century Prince Vladimir who curses God following the death of his beloved wife and is turned into a vampire. Later, in 19th century London, he discovers his wife’s doppelgänger and dooms himself by pursuing her.', '/ykyRfv7JDofLxXLAwtLXaSuaFfM.jpg', '/nt0HRxlzOXRpPJtl2FmeBCO6MeR.jpg', 'upcoming', '2025-07-30', 7.218, 186, '2025-10-13 21:47:27', '2025-10-13 21:47:27'),
(63, 1197137, 'Black Phone 2', 'Four years after escaping The Grabber, Finney Blake is struggling with his life after captivity. When his sister Gwen begins receiving calls in her dreams from the black phone and seeing disturbing visions of three boys being stalked at a winter camp, the siblings become determined to solve the mystery and confront a killer who has grown more powerful in death and more significant to them than either could imagine.', '/evbguUd1BwExQgXMjG9n9AHMQpN.jpg', '/GNeuKnbZRZj5JhKfnJOPyKJuVA.jpg', 'upcoming', '2025-10-15', 7.2, 2, '2025-10-13 21:47:27', '2025-10-13 21:47:27'),
(64, 14836, 'Coraline', 'Wandering her rambling old house in her boring new town, 11-year-old Coraline discovers a hidden door to a strangely idealized version of her life. In order to stay in the fantasy, she must make a frighteningly real sacrifice.', '/4jeFXQYytChdZYE9JYO7Un87IlW.jpg', '/hofnlIyF6bePkgQOpcuRWLvzf15.jpg', 'upcoming', '2009-02-05', 7.897, 8581, '2025-10-13 21:47:28', '2025-10-13 21:47:28'),
(65, 974397, 'My Freaky Family', 'On the cusp of her 13th birthday, Betty Flood – budding musician and magical being – just wants to be like the rest of her fabulous, but very different family, so why is her magical Mum so against it? As Betty wrestles with this, she also learns the amazing truth about her family and discovers that the not so normal, the magical and the musical are all a part of her fabulously freaky family. It\'s very freaky, so be freaked freaky ahh deaky peaky neaky seaky peaky poo.', '/h34lkT2CFufYuzmP0CEgn4lghyY.jpg', '/qDAvAUsnRrvkFO5EtNq1XFfyYTL.jpg', 'upcoming', '2024-04-25', 7, 6, '2025-10-13 21:47:28', '2025-10-13 21:47:28'),
(66, 1422096, 'Good Boy', 'A loyal dog moves to a rural family home with his owner Todd, only to discover supernatural forces lurking in the shadows. As dark entities threaten his human companion, the brave pup must fight to protect the one he loves most.', '/pvMHRi09ur2L1drXh2dXFtuMFgl.jpg', '/7HegXCtNSuqSYgpuoR46gtQvw2V.jpg', 'upcoming', '2025-10-01', 7.271, 72, '2025-10-13 21:47:29', '2025-10-13 21:47:29'),
(67, 1242898, 'Predator: Badlands', 'Cast out from his clan, an alien hunter finds an unlikely ally in a damaged android and embarks on a treacherous journey in search of the ultimate adversary.', '/pHpq9yNUIo6aDoCXEBzjSolywgz.jpg', '/lfh5nPP2Rsx9sZQZrLxL8GsmgoA.jpg', 'upcoming', '2025-11-05', 0, 0, '2025-10-13 21:47:29', '2025-10-13 21:47:29'),
(68, 760329, 'The Smashing Machine', 'In the late 1990s, up-and-coming mixed martial artist Mark Kerr aspires to become the greatest fighter in the world. However, he must also battle his opiod dependence and a volatile relationship with his girlfriend Dawn.', '/vMDqKiWCciWsF8Q3RCk3YSrZx0y.jpg', '/spVx2wKmvoaO7M5OOfGthCp7PRt.jpg', 'upcoming', '2025-10-01', 6.602, 45, '2025-10-13 21:47:29', '2025-10-13 21:47:29'),
(69, 1064307, 'Spermageddon', 'Two narrative threads: one is an emerging love story between awkward teens Jens and Lisa, who are having sex for the first time; the other, an eventful quest of Simon the Semen and his friends to reach the golden goal, the Egg.', '/n7SFxle8CVzMXzfV8GNCXqdg78m.jpg', '/5OEcsHKZy9TLFz9qXLp5NJN9K8e.jpg', 'upcoming', '2025-02-21', 6.5, 86, '2025-10-13 21:47:30', '2025-10-13 21:47:30'),
(70, 842924, 'The Life of Chuck', 'In this extraordinary story of an ordinary man, Charles \'Chuck\' Krantz experiences the wonder of love, the heartbreak of loss, and the multitudes contained in all of us.', '/oumprkO9bThExP8NwxBIBnvBu2v.jpg', '/51jDSREvaYRGjXBKd7jSSoOhFgc.jpg', 'upcoming', '2025-06-05', 7.4, 457, '2025-10-13 21:47:30', '2025-10-13 21:47:30'),
(71, 1314398, 'Frieda\'s Case', 'Chronicles the fate of Frieda Keller, a young seamstress in St. Gallen who, in 1904, is accused of murdering her 5-year-old son Ernstli.', '/nPhO7N3IOjEiNQop4yBLQUWJNXL.jpg', '/nNsFyoW1txmCdoDT3QApCIGopnI.jpg', 'upcoming', '2025-10-30', 0, 0, '2025-10-13 21:47:31', '2025-10-13 21:47:31'),
(72, 1280282, 'Gabby\'s Dollhouse: The Movie', 'Gabby heads out on a road trip with her Grandma Gigi to the urban wonderland of Cat Francisco. But when Gabby\'s dollhouse, her most prized possession, ends up in the hands of an eccentric cat lady named Vera, Gabby sets off on an adventure through the real world to get the Gabby Cats back together and save the dollhouse before it\'s too late.', '/t6LLguAmu6iZUN8pWhT7Q0IcaQ5.jpg', '/MrcSSzWGsXf2IUJpjPPFLlNbjX.jpg', 'upcoming', '2025-09-13', 7.214, 14, '2025-10-13 21:47:31', '2025-10-13 21:47:31'),
(73, 8966, 'Twilight', 'When Bella Swan moves to a small town in the Pacific Northwest, she falls in love with Edward Cullen, a mysterious classmate who reveals himself to be a 108-year-old vampire. Despite Edward\'s repeated cautions, Bella can\'t stay away from him, a fatal move that endangers her own life.', '/3Gkb6jm6962ADUPaCBqzz9CTbn9.jpg', '/weAYfu6FfrNxEDJ3xH1XpgQcqUv.jpg', 'upcoming', '2008-11-20', 6.287, 14000, '2025-10-13 21:47:31', '2025-10-13 21:47:31'),
(74, 1305653, 'Dongji Rescue', 'During WWII, in the waters near Zhoushan, China, a Japanese freighter carrying British POWs was sunk, leaving thousands trapped inside by the Japanese military. In this desperate situation, a group of fishermen from Dongji Island step forward without hesitation. Driven by their innate kindness, courage, and unyielding spirit, they brave the stormy seas to open a path of survival for the stranded prisoners.', '/1eb3YebyscUmXmrrC2ZDDVR0w0P.jpg', '/uIawpKlAVKBWH9Sc8PpA8TefWW2.jpg', 'upcoming', '2025-08-08', 7.3, 13, '2025-10-13 21:47:32', '2025-10-13 21:47:32'),
(75, 1337562, 'Splitsville', 'After Ashley asks for a divorce, good-natured Carey runs to his friends, Julie and Paul, for support. He’s shocked to discover that the secret to their happiness is an open marriage, that is until Carey crosses the line and throws all of their relationships into chaos.', '/gxCv6kUdywxYzIXX6xYcmX5APUV.jpg', '/1s2qd3Og2vPiqYgWxt8BpTyH3n4.jpg', 'upcoming', '2025-08-21', 6.5, 71, '2025-10-13 21:47:32', '2025-10-13 21:47:32'),
(76, 1124619, 'Bride Hard', 'Sam is a secret agent whose toughest mission to date is pleasing her bride-to-be best friend at a lavish destination wedding. When a team of mercenaries crashes the party and takes the guests hostage, Sam is thrown into a fight unlike any before — one where she can’t risk blowing her cover or ruining the big day. As she takes on the bad guys in a high-stakes battle disguised as a fairy-tale affair, she realizes the real threat might be closer than she thinks.', '/pVli4kL16OFYPWvn5yTnZusX4l0.jpg', '/2DcD4Hh80SW7YVpwckkiEFRZX06.jpg', 'upcoming', '2025-06-19', 5.581, 117, '2025-10-13 21:47:33', '2025-10-13 21:47:33'),
(77, 1010756, 'The Strangers: Chapter 2', 'When The Strangers learn that one of their victims, Maya, is still alive, they return to finish what they’ve started.', '/pqADzs5SJvI2jC0DThPVMuNJcWS.jpg', '/sSaUmM4bnZJ7PW5dlyRi7iONB65.jpg', 'upcoming', '2025-09-25', 4.9, 19, '2025-10-13 21:47:33', '2025-10-13 21:47:33'),
(78, 926606, 'The Home', 'A troubled man starts working at a retirement home and realizes its residents and caretakers harbor sinister secrets. As he investigates the building and its forbidden fourth floor, he starts to uncover connections to his own past and upbringing as a foster child.', '/v8oSjAv37tWWzPlk2YfvZz55F9Z.jpg', '/IOEXDwaVH2IcSXIZhCg7g572ic.jpg', 'upcoming', '2025-07-24', 6.424, 92, '2025-10-13 21:47:33', '2025-10-13 21:47:33'),
(79, 105, 'Back to the Future', 'Eighties teenager Marty McFly is accidentally sent back in time to 1955, inadvertently disrupting his parents\' first meeting and attracting his mother\'s romantic interest. Marty must repair the damage to history by rekindling his parents\' romance and - with the help of his eccentric inventor friend Doc Brown - return to 1985.', '/vN5B5WgYscRGcQpVhHl6p9DDTP0.jpg', '/5bzPWQ2dFUl2aZKkp7ILJVVkRed.jpg', 'upcoming', '1985-07-03', 8.3, 20944, '2025-10-13 21:47:34', '2025-10-13 21:47:34'),
(80, 1319969, 'Sketch', 'When a young girl’s sketchbook falls into a strange pond, her drawings come to life—chaotic, real, and on the loose. As the town descends into chaos, her family must reunite and stop the monsters they never meant to unleash.', '/sxiDj3dTgZuCPkx30Jvyq8K9QUV.jpg', '/3htgvJ6d0GV633oHYueeISk8J7w.jpg', 'upcoming', '2025-08-06', 7.152, 56, '2025-10-13 21:47:34', '2025-10-13 21:47:34'),
(81, 1242419, 'Roofman', 'A former Army Ranger and struggling father turns to robbing McDonald’s restaurants by cutting holes in their roofs, earning him the nickname \'Roofman\'. After escaping prison, he secretly lives inside a Toys “R” Us for six months, surviving undetected while planning his next move. But when he falls for a divorced mom drawn to his undeniable charm, his double life begins to unravel, setting off a compelling and suspenseful game of cat and mouse as his past closes in.', '/uhXxW7EmzZIWFVpbF42r6L2g7Oh.jpg', '/6kfP6PIxUVqtkJeBxkFGQ8UHZLS.jpg', 'upcoming', '2025-10-08', 7.2, 15, '2025-10-13 21:47:35', '2025-10-13 21:47:35'),
(82, 18239, 'The Twilight Saga: New Moon', 'Forks, Washington resident Bella Swan is reeling from the departure of her vampire love, Edward Cullen, and finds comfort in her friendship with Jacob Black, a werewolf. But before she knows it, she\'s thrust into a centuries-old conflict, and her desire to be with Edward at any cost leads her to take greater and greater risks.', '/k2qTooPlHffgNABNWxeJdGMglPK.jpg', '/dF2c20sRDgySZLaLS2OUerL07sz.jpg', 'upcoming', '2009-11-18', 5.995, 9495, '2025-10-13 21:47:35', '2025-10-13 21:47:35'),
(83, 639988, 'No Other Choice', 'After being laid off and humiliated by a ruthless job market, a veteran paper mill manager descends into violence in a desperate bid to reclaim his dignity.', '/i38zFYpbBnWbqcRayu9F1n71yVT.jpg', '/s6aB9kjxNg0mu2361IkCUSpyHJV.jpg', 'upcoming', '2025-09-24', 8.2, 15, '2025-10-13 21:47:35', '2025-10-13 21:47:35'),
(84, 1241921, 'A Big Bold Beautiful Journey', 'Sarah and David are single strangers who meet at a mutual friend’s wedding and soon, through a surprising twist of fate, find themselves on a funny, fantastical, sweeping adventure together where they get to re-live important moments from their respective pasts, illuminating how they got to where they are in the present... and possibly getting a chance to alter their futures.', '/dYm4Ah0UAgBHkYEPZIhuhkzl6ue.jpg', '/2ha0wAOqrUcLScStWQcgeOOXapQ.jpg', 'upcoming', '2025-09-17', 6.3, 83, '2025-10-13 21:47:36', '2025-10-13 21:47:36'),
(85, 1097549, 'Babygirl', 'A high-powered CEO puts her career and family on the line when she begins a torrid affair with her much younger intern.', '/ilwO6elz3mLV9CToT7C8pjVeKX0.jpg', '/s7vWRjcfRVMW8tBIxhC3UhKxRoo.jpg', 'upcoming', '2024-12-25', 5.726, 967, '2025-10-13 21:47:36', '2025-10-13 21:47:36');
